import React from "react";
import { useState } from "react";
import { BrowserView, MobileOnlyView } from "react-device-detect";
import Launch_Mobile from "modules/photoBooth/components/pbMobile";
import Desktop_Title from "modules/photoBooth/components/desktopTitle";
import Desktop_Booth from "modules/photoBooth/components/desktopBooth";
import Header from "modules/photoBooth/components/pbTitle";

const PhotoBooth = () => {
  const [page, setPage] = useState("TITLE");
  let content = <Desktop_Title />;

  if (page === "TITLE") {
    content = <Desktop_Title />;
  } else if (page === "BOOTH") {
    content = <Desktop_Booth />;
  }

  return (
    <body bgcolor="black">
      <Header></Header>
      <BrowserView>{content}</BrowserView>
      <MobileOnlyView>
        <Launch_Mobile />
      </MobileOnlyView>
    </body>
  );
};

export default PhotoBooth;
